import React from "react";
import Upload from "../common/svg/upload";
import Dashboard from "../common/svg/dashboard";

const Sidebar = () => {
  return (
    <aside>
      <nav>
        <div>
          <button class="border  border-primary  bg-primaryFade text-primary flex items-center gap-3 p-2 cursor-pointer rounded-lg hover:bg-primaryFade transition-all">
            <div class="flex justify-center">

            </div>
            <div className="navAlign">
              <Dashboard />
            </div>
          </button>
        </div>
        <div>
          <button class="border  border-primary  bg-primaryFade text-primary flex items-center gap-3 p-2 cursor-pointer rounded-lg hover:bg-primaryFade transition-all">
            <div class="flex justify-center">
              <Upload />
            </div>
          </button>
        </div>
      </nav>
    </aside>
  );
};

export default Sidebar;
